import React, { useRef, useMemo } from 'react';
import { useTable,usePagination  } from 'react-table';
//npm install react-table
import './JavaProjects.css'; 
import './bootstrap-scoped.css';


function JavaProjects() {
  const gridViewRef = useRef(null);
  // Sample data (replace with your actual data)
  const data = useMemo(() => [
    {
      id: '1',
      name: (
        <div>
        <p>Order Table</p> 
        <p>(Spring Boot Project)</p>
        <a href='https://github.com/fusumwan/JavaWebAppProject/tree/main/ordertableweb' target="_blank" rel="noopener noreferrer">download</a>
        <table>
          <tr>
            <td style={{ width: '350px' }}>
            At my previous company, I developed and maintained various web systems, including small-scale ones for internal use like report generation. These projects are showcased on my YouTube channel, offering insights into their functionalities and potential suitability for your company's needs.
            </td>
          </tr>
        </table>
        </div>
      ),
      description: (
        <div>
          <iframe
            width="275"
            height="157"
            src="https://www.youtube.com/embed/bA9zRNYOW7Y"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
            title="Order Table (Spring Boot Project) Video"
          ></iframe>
        </div>
      )
    },
    {
      id: '2',
      name: (
        <div>
        <p>Order Table</p> 
        <p>(Spring Boot & Security)</p>
        <a href='https://github.com/fusumwan/JavaWebAppProject/tree/main/ordertableweb' target="_blank" rel="noopener noreferrer">download</a>

        </div>
      ),
      description: (
        <div>
          <iframe
            width="275"
            height="157"
            src="https://www.youtube.com/embed/-naOyhX9buI"
            frameBorder="0"
            allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture"
            allowFullScreen
            title="Order Table (Spring Boot & Security)"
          ></iframe>
        </div>
      )
    },
    {
      id: '3',
      name:  (
        <div>
